import classes from './MyPosts.module.css'
import Post from './Post/Post';

const MyPosts = () => {

  let PostData =[
    {id: 1, messages: "Hi, how are you", likesCount: 15},
    {id: 2,messages: "it's my first post",likesCount: 20},
]

  return (
    <div className={classes.postsBlock}>
      <h3>My Post</h3>
      <div>
        <div>
          <textarea></textarea>
        </div>
        <div>
          <button>add post</button>
        </div>
      </div>
      <div className={classes.posts}>
        <Post message={PostData[0].messages} like={PostData[0].likesCount} />
        <Post message={PostData[1].messages} like={PostData[1].likesCount} />
      </div>
    </div>
  );
}

export default MyPosts;
